import React from "react";
import {
  Text,
  StyleSheet,
  View,
  ImageBackground,
  TouchableOpacity,
  Button,
} from "react-native";

const WelcomeScreen = ({ navigation }) => {
  return (
    <ImageBackground
      style={styles.background}
      source={{
        uri: "https://source.unsplash.com/featured/?abstract,background",
      }}
    >
      <View style={styles.overlay}>
        <Button style={styles.buttons} />
        <Button style={styles.buttons} />
      </View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  background: {
    flex: 1,
    backgroundColor: "black",
    opacity: 0.75,
  },

  overlay: {
    flex: 1,
    justifyContent: "center",
  },
  buttons: {
    margin: 20,
    padding: 15,
    color: "white",
    backgroundColor: "darkslateblue",
  },
});
export default WelcomeScreen;
